import React from 'react'
import styled from "styled-components"
import HomeImage from "../assets/woman-holding-bar.jpeg"
import Nav from "./Nav"


const Wrapper = styled.div`
  img {
    width: 100%;
    height: 100vh;
  }
  .filter {
    height: 100vh;
    width: 100%;
    position: absolute;
    top: 0;
    left: 0;
    opacity: calc(28 / 100);
    background: #403f3f;
  }
  .content {
    position: absolute;
    top: 0;
    margin-top: 13%;
    margin-left: 10%;
    font-family: "Poppins", sans-serif;
  }

  h1 {
    color: #e2ded3;
    font-size: 100px;
    font-weight: 200;
    line-height: 100px;
  }

  h4 {
    color: #e2ded3;
    letter-spacing: 8px;
    margin-top: 0.5em;
  }

  button {
    background: transparent;
    border: 1px solid #e2ded3;
    color: #e2ded3;
    font-size: 24px;
    font-weight: 100;
    padding: 0.25em;
    margin-top: 1em;
  }
  .background-photo {
    position: absolute;
    top: 0;
    z-index: -1;
  }

  video {
    display: none;
  }

  @media only screen and (max-width: 600px) {
    img {
      display: none;
    }
    video {
      width: 100%;
      height: 100vh;
    }
  }
`;

function Homepage() {
    return (
      <Wrapper>
        <Nav style={{position: "absolute", zIndex: 2}} />
        <div className="background-photo">
            <img src={HomeImage} alt=""/>
            <video loop autoPlay>
              <source src={JumpVid} type="video/mp4"/>
                Your browser does not support the video tag.
            </video>
            <div className="filter"></div>
            <div className="content">
                <h1>CROSSFIT <br/> ATTIX</h1>
                <h4>Denver | Centennial | Boulder</h4>
                <button>Try a class for free</button>
            </div>
        </div>
      </Wrapper>
    );
}

export default Homepage
